import React from 'react';
import './styles/App.css';
import NotesList from './components/Table';
import { useTypedSelector } from './hooks/useTypeSelector';
import { getActiveNotes, getArchiveNotes } from './services/noteService';
import { getInfoAboutCategoryes } from './services/categoryService';
import MyButton from './components/UI/MyButton/MyButton';
import MyModal from './components/UI/MyModal/MyModule';

function App() {
  const {notes} = useTypedSelector(state => state.note);

  const activeNotes = getActiveNotes(notes);
  const archivedNotes = getArchiveNotes(notes);

  return (
    <div className="App">
      <MyModal visible={true} setVisisble={() => {}} onClickFunction={() => {}}/>
      <NotesList data={activeNotes} type='active big' isCategory = {false}>Active list</NotesList>

      <div className='buttonWrapper'>
        <MyButton onClickFunction={() => {}}>Add note</MyButton>
      </div>

      <NotesList data={archivedNotes} type='archive big' isCategory = {false}>Archived list</NotesList>
      <NotesList data={getInfoAboutCategoryes(notes)} type='summary small' isCategory = {true}>Summary info</NotesList>
    </div>
  );
}

export default App;
